import React from "react";
import { Link } from "react-router-dom";

const Nav = () => (
  <menu>
    <Link to="/about" id="aboutme-link">
      About
    </Link>
    <Link to="/portfolio" id="portfolio-link">
      Portfolio
    </Link>
  </menu>
);

export default Nav;
